// components/Landing.js
import React from 'react';
import './Landing.css'; // Assuming you will add CSS styles here for positioning

function Landing() {
  return (
    <div className="landing">
      <nav className="navbar">
        <ul>
          <li><image></image></li>
          <li className="active">Home</li>
          <li>About Us</li>
          <li>Price Predictor</li>
          <li>Contact Us</li>
        </ul>
      </nav>
      <div className="landing-text">
        <h1>
        <span className="farm">Farm</span>
        <span className="eazyy">Eazyy</span>
        </h1>
      </div>
    </div>
  );
}

export default Landing;
